    [],nt"num_tags": 6,nt"name": "selawik-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Selawik
    National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, the management plan, public participation, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, fire management,
    and wilderness areas. The wildlife section of the report discusses wildlife diversity,
    waterfowl, shorebirds, raptors, game mammals, marine mammals, fisheries resources,
    and marking and banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, trapping, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, and communication systems. Cooperative programs and items
    of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
